import React from "react";

function Map() {
  return (
    <>
      <p className="title-map">
        You can use our services anywhere in the world
      </p>
      <p className="subtitle-map">
        Withdraw and transfer money online through our application
      </p>
      <div className="svg">
        <img src="./images/map.png" alt="" />
      </div>
    </>
  );
}

export default Map;
